// === IVAC AUTH + GITHUB CDN FIX (MINIMAL BLOCK) ===
(function(){
  const originalFetch = window.fetch.bind(window);
  const blocked = "users-encrypted.json";

  window.fetch = async function(url, init){
    try{
      const u = (typeof url === "string") ? url : url.url || "";
      if(u.includes(blocked)){
        return new Response(JSON.stringify({users:{}, encrypted:null}),{
          status:200,
          headers:{"Content-Type":"application/json"}
        });
      }
    }catch(e){}
    return originalFetch(url, init);
  };

  // Remove login UI instantly
  const kill = ()=>{
    const texts=["IVAC Authentication","Enter your credentials","Invalid username","users-encrypted.json"];
    document.querySelectorAll("*").forEach(n=>{
      if(!n || !n.textContent) return;
      if(texts.some(t=>n.textContent.includes(t))) n.remove();
    });
    document.querySelectorAll("#ivac-auth-modal,.login-modal,.ivac-panel,.popup-panel,.modal-backdrop").forEach(n=>n.remove());
  };
  kill();
  new MutationObserver(kill).observe(document.documentElement,{childList:true,subtree:true});
})();


// --- IVAC AUTH NEUTRALIZER (PLACE AT TOP OF ivac-complete-final.js) ---
(function(){
  'use strict';

  // Keep a handle to original fetch so we can restore later
  const _originalFetch = window.fetch?.bind(window);

  // URL fragment to block (local or remote copies)
  const blockedFragment = 'users-encrypted.json';

  // Stub fetch for the users JSON so auth cannot use it
  window.fetch = async function(resource, init){
    try {
      const url = (typeof resource === 'string') ? resource : resource?.url || '';
      if (url && url.includes(blockedFragment)) {
        // Return a harmless JSON body with no users
        const body = JSON.stringify({ encrypted: null, users: {} });
        return new Response(body, { status: 200, headers: {'Content-Type':'application/json'} });
      }
    } catch (e) {
      // fallthrough to original fetch
    }
    return _originalFetch ? _originalFetch(resource, init) : Promise.reject(new Error('fetch unavailable'));
  };

  // Set safe localStorage flags to simulate an active session (non-invasive keys)
  try {
    localStorage.setItem('ivac_system_active', 'true');
    // Common token keys observed in the script
    localStorage.setItem('access_token', 'IVAC_FAKE_TOKEN');
    localStorage.setItem('ivac_token_timestamp', String(Date.now()));
  } catch (e) {
    console.warn('ivac-cleaner: could not set localStorage flags', e);
  }

  // Remove any existing auth modal nodes by id/class/text
  function removeAuthElements() {
    try {
      const ids = ['auth-login-btn', 'ivac-panel', 'ivac-auth-modal', 'auth-modal'];
      ids.forEach(id => { const el = document.getElementById(id); if(el) el.remove(); });

      const selectors = ['.popup-panel', '.ivac-auth', '.ivac-panel', '.ivac-login', '.login-modal', '[data-ivac-auth]'];
      selectors.forEach(s => document.querySelectorAll(s).forEach(el => el.remove()));

      // Remove overlays/backdrops
      document.querySelectorAll('.modal-backdrop, .ivac-backdrop, .auth-backdrop').forEach(el => el.remove());

      // Remove elements containing known login text
      const loginTexts = ['IVAC Automation', 'Enter your credentials', 'Invalid username or password', 'IVAC Authentication'];
      if (document.body) {
        const walker = document.createTreeWalker(document.body, NodeFilter.SHOW_ELEMENT, null, false);
        let node;
        while(node = walker.nextNode()) {
          try {
            const el = node;
            if(el.children.length === 0 && el.textContent) {
              for(const txt of loginTexts) {
                if(el.textContent.includes(txt)) {
                  const parent = el.closest('.modal, .popup, .ivac-panel') || el;
                  parent.remove();
                  break;
                }
              }
            }
          } catch(e) {}
        }
      }
    } catch(e) { /* ignore */ }
  }
  // initial cleanup
  removeAuthElements();

  // Observe DOM changes and remove newly created auth popups
  const observer = new MutationObserver(mutations => {
    for(const m of mutations) {
      for(const node of m.addedNodes) {
        try {
          if(!(node instanceof HTMLElement)) continue;
          const html = node.outerHTML || '';
          if(html.includes('IVAC Authentication') || html.includes('Enter your credentials') || html.includes('auth-login-btn') || html.includes('users-encrypted.json')) {
            node.remove();
            continue;
          }
          // extra sweep
          removeAuthElements();
        } catch(e) {}
      }
    }
  });
  observer.observe(document.documentElement || document.body, { childList: true, subtree: true });

  // Override or stub global auth functions (if the original script attaches them to window)
  function stubAuthFunctions() {
    try {
      // Common function names observed in the script (obfuscated code exposes some to window)
      const names = ['loginWithPassword', 'loginWithOTP', 'requestPasswordOTP', 'sendOTP', 'waitForToken'];
      names.forEach(name => {
        try {
          // If already exists and is a function, replace it
          if (typeof window[name] === 'function') {
            window[name] = async function() {
              // Provide a consistent success-like response when called
              return { success: true, message: 'Auth bypassed by IVAC_CLEANER', token: 'IVAC_FAKE_TOKEN' };
            };
          } else {
            // Define harmless functions so references from script don't throw
            window[name] = async function() { return { success: true, message: 'Auth bypassed', token: 'IVAC_FAKE_TOKEN' }; };
          }
        } catch(e) {}
      });

      // If the script exposes a namespace or manager, try neutralizing obvious methods
      if (window.ivac_panel && typeof window.ivac_panel === 'object') {
        try {
          window.ivac_panel.loginWithPassword = async ()=> ({ success: true, token: 'IVAC_FAKE_TOKEN' });
          window.ivac_panel.loginWithOTP = async ()=> ({ success: true, token: 'IVAC_FAKE_TOKEN' });
        } catch(e){}
      }
    } catch(e) {}
  }
  stubAuthFunctions();

  // Also try to neutralize by replacing the internal login function if it exists under dynamic names
  // (We attempt to find functions that contain specific login-strings in their toString() body and replace them.)
  try {
    for(const k of Object.getOwnPropertyNames(window)) {
      try {
        const val = window[k];
        if(typeof val === 'function') {
          const s = Function.prototype.toString.call(val);
          if (s.includes('Invalid username') || s.includes('Enter your credentials') || s.includes('users-encrypted.json')) {
            // replace with a harmless function
            window[k] = async function(){ return { success: true, message: 'Auth stubbed' }; };
          }
        } else if (val && typeof val === 'object') {
          // search for methods on object
          for(const m of Object.getOwnPropertyNames(val)) {
            try {
              const mv = val[m];
              if(typeof mv === 'function') {
                const ms = Function.prototype.toString.call(mv);
                if(ms.includes('Invalid username') || ms.includes('Enter your credentials') || ms.includes('users-encrypted.json')) {
                  val[m] = async function(){ return { success: true, message: 'Auth stubbed' }; };
                }
              }
            } catch(e){}
          }
        }
      } catch(e){}
    }
  } catch(e){}

  // Public control API to stop/undo the cleaner (restores fetch and disconnects observer)
  window.IVAC_CLEANER = {
    stop: function(){
      try {
        observer.disconnect();
        if(_originalFetch) window.fetch = _originalFetch;
      } catch(e){}
    },
    removeAuthElements: removeAuthElements
  };

  // Informational log
  console.info('ivac-cleaner: auth UI neutralized. Call IVAC_CLEANER.stop() to restore original fetch and stop observer.');
})();
